import {Link, Outlet} from 'react-router-dom';
import TopHeader from "../components/TopHeader";
import Team from "../components/Team";

const AboutPage = () =>{
	return(
		<>
			<div classNameName="main-content inner" id="home" >
	      		<TopHeader/>
	      	</div>
	      	<Team/>
      	</>
		);
}

export default AboutPage;
